import React, { Component } from 'react';
import Players from './components/players';

class Game extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <h1>{this.props.username}</h1>
                <Players allPlayers={this.props.allPlayers}/>
            </div>
        );
    }
}
 
export default Game;
